metadata.description:
"Wherever you go I can always summon you back."

The Summoning is a collaborative project between @astonauticus and @superbialux.

Features and variations:
1) Hue (2);
2) Birds (2);
3) Dress (2);
4) Face (5);
5) Hair (5);
6) Summoning (4).

Some of the variations are extremely rare.

Twitter: @astonauticus, @superbialux.
